#define MAXQSIZE 100 typedef ?struct { QElemType ???*base; int front; int rear; int tag; } CyQueue; Status EnCyQueue(CyQueue &Q,int x)//带tag域的循环队列入队算法
{
if(Q.front==Q.rear&&Q.tag==1) //tag域的值为0表示"空",1表示"满"
return OVERFLOW;
Q.base[Q.rear]=x;
Q.rear=(Q.rear+1)%MAXSIZE;
if(Q.front==Q.rear) Q.tag=1; //队列满
}//EnCyQueue Status DeCyQueue(CyQueue &Q,int &x)//带tag域的循环队列出队算法
{
if(Q.front==Q.rear&&Q.tag==0) return INFEASIBLE; x=Q.base[Q.front];
Q.front=(Q.front+1)%MAXSIZE;
if(Q.front==Q.rear) Q.tag=0; //队列空
return OK;
}//DeCyQueue

